// DU-Bus-Tracker.js
import React from 'react';
import githubIcon from './logo/github.png';
import youtubeIcon from './logo/cf.png';
import './ProjectCardStyle.css';

const DU_Bus_Tracker = () => {
  const projectData = {
    title: 'DU Bus Tracker',
    description: 'A bus tracking project for DU campus.',
    githubLink: 'https://github.com/yourusername/DU-Bus-Tracker',
    youtubeLink: 'https://youtube.com/yourusername/DU-Bus-Tracker',
    image1: './logo/spectre.jpg', // Adjust the paths accordingly
    image2: '/path/to/image2.jpg',
  };

  return (
    <div className="project-card">
      <div className="images-section">
        <div className="image-container">
          <img src={projectData.image1} alt="Project Image 1" className="project-image" />
          <a href={projectData.githubLink} target="_blank" rel="noopener noreferrer">
            <img src={githubIcon} alt="GitHub Icon" className="social-icon" />
          </a>
        </div>
        <div className="image-container">
          <img src={projectData.image2} alt="Project Image 2" className="project-image" />
          <a href={projectData.youtubeLink} target="_blank" rel="noopener noreferrer">
            <img src={youtubeIcon} alt="YouTube Icon" className="social-icon" />
          </a>
        </div>
      </div>
      <div className="description-section">
        <h3>{projectData.title}</h3>
        <p>{projectData.description}</p>
      </div>
    </div>
  );
};

export default DU_Bus_Tracker;
